INSERT INTO `shop` VALUES ('b7b8787b-ee3d-480f-98b7-084481a8010d', '001', '八路通深圳西乡店', 'shop1.png', '深圳市宝安五十区海景花园一层(宝安大道与开屏路交界处)', '八路通深圳西乡店成立于2008年，维修师傅曾就职上海大众、奔驰、别克4S店。熟悉德系、日系、韩系等常用车型。 美容师傅有五年以上工作经验，擅长镀晶、打蜡、贴膜等项目。', '13538046066', '', '2016-12-30', '29971491/18038094463');
INSERT INTO `shop` VALUES ('b7b8787b-ee3d-480f-98b7-084481a8010e', '002', '八路通深圳红岭店', 'shop2.png', '深圳市福田区红岭北路3001号先科大院3栋108号（泥岗西路与红岭北路交界处）', '八路通深圳红岭店成立于2004年，维修师傅曾就职本田、丰田、奥迪、奔驰大兴4S店。熟悉欧洲系及国产车系列常用车型。\r\n', '13392809689', '', '2016-12-30', '13392809689');
INSERT INTO `shop` VALUES ('b7b8787b-ee3d-480f-98b7-084481a8010f', '003', '八路通深圳横岗店', 'shop3.png', '深圳市龙岗区龙岗大道转入荷康路200米（导航荷坳地铁站B出口)', '八路通深圳横岗店成立于2014年，维修师傅曾就职一汽大众、马自达、奔驰、宝马、奥迪、路虎、保时捷4S店。熟悉德系、日系、韩系等常用车型。美容师傅有10年以上的工作经验，擅长镀金、打蜡、贴膜等项目。\r\n', '13510171260', '', '2016-12-30', '13510171260');
INSERT INTO `shop` VALUES ('b7b8787b-ee3d-480f-98b7-084481a8010g', '004', '八路通深圳罗芳店', 'shop4.png', '深圳市罗湖区罗芳路91号二楼', '八路通深圳罗芳店成立于1998年,维修师傅曾就职奔驰、宝马、奥迪、4S店。熟悉德系、日系、韩系等常用车型。', '13510020009', '', '2016-12-30', '13510020009');
INSERT INTO `shop` VALUES ('b7b8787b-ee3d-480f-98b7-084481a8010h', '005', '八路通深圳新洲店', 'shop5.png', '深圳市福田区下梅林梅华路217号嘉梅小区1号商铺', '八路通深圳新洲店成立于2014年,维修师傅曾就职比亚迪、上海大众、丰田、奥迪、宝马捷豹4S店。熟悉德系、日系、韩系等常用车型。 美容师傅有五年以上工作经验，擅长镀晶、打蜡、贴膜等项目。\r\n ', '18038033335', '', '2016-12-30', '18038033335');
INSERT INTO `shop` VALUES ('b7b8787b-ee3d-480f-98b7-084481a8010i', '006', '八路通深圳龙岗店', 'shop6.png', '深圳市龙岗区南通道爱南路353号（永茂行汽车服务有限公司隔壁）', '八路通深圳龙岗店成立于2014年,维修师傅曾就职风行、荣威、丰田4S店。熟悉德系、日系、韩系等常用车型。 \r\n', '15012936204', '', '2016-12-30', '15012936204');
